  input: TEXT,F3XA,,"This report has been amended to show on Line 30b the payments
    made for salaries and wages for employees who spent more than 25 percent of their
    compensated time on Federal Election Activity. This amendment has been completed
    in response to the Federal Election Commission's letter dated August 25, 2004.
    Republican Federal Committee of PA transferred $28,780.26 on 2/05/2004 from the
    non-federal acct to the federal acct. The allocation splits were reflected in
    the year end report of 2003.  Under FEC Regulations 106.6 2 timing of transfers
    between accounts. B Except as provided in paragraph f, s)of this sections, such
    funds may not be transferred more than 10 days before or more than 60 days after
    the payments for which they are designated are made.  This allocation falls within
    the designated 60 day window to transfer the funds for allocation purposes. Expenditures
    were made beginning on 12/11/2003 thru 12/30/03. $15,339.48 was transferred from
    our non-federal to our federal account on 3/11/04. The expenditures were made
    1/12/04 thru 2/19/04.  The non-federal and federal shares are reflected on the
    Feb 20th and March 20th, 2004 reports.  Republican Federal Committee of PA believes
    that they have acted within the law with regards to the transfers."
